import logo from './logo.svg';
import './App.css';

function App() {
  const handleClick = () => {
    console.log('Click happened');
  }
  return (
    <div>
      <button type="button" onClick={handleClick}>
        Click Me
      </button>
    </div>
  );
}

export default App;
